    CONSTRAINT TELEFONO_ID_USUARIO_FK FOREIGN KEY (ID_USUARIO)
    REFERENCES FIDE_USUARIO_TB(ID_USUARIO)
)
TABLESPACE FIDE_PROYECTO_FINAL_TBS;

CREATE TABLE FIDE_CORREO_TB (
  ID_CORREO VARCHAR2(50),
