CREATE TABLE FIDE_FACTURACION_TB (
  ID_FACTURA VARCHAR2(50),
  ID_EMPLEADO VARCHAR2(50),
  ID_CAJA VARCHAR2(50),
  ID_USUARIO VARCHAR2(50),
  FECHA DATE,
  MONTO_TOTAL NUMBER(10,2),
  CONSTRAINT FACTURACION_ID_FACTURA_PK PRIMARY KEY (ID_FACTURA),
  CONSTRAINT FACTURACION_ID_EMPLEADO_FK FOREIGN KEY (ID_EMPLEADO)
    REFERENCES FIDE_EMPLEADO_TB(ID_EMPLEADO),
  CONSTRAINT FACTURACION_ID_CAJA_FK FOREIGN KEY (ID_CAJA)
    REFERENCES FIDE_CAJA_TB(ID_CAJA),
  CONSTRAINT FACTURACION_ID_USUARIO_FK FOREIGN KEY (ID_USUARIO)
    REFERENCES FIDE_USUARIO_TB(ID_USUARIO)
)
TABLESPACE FIDE_PROYECTO_FINAL_TBS
PARTITION BY RANGE (FECHA) 
(
  PARTITION FACT_ENE_2024 VALUES LESS THAN (TO_DATE('2024-02-01', 'YYYY-MM-DD')) TABLESPACE FIDE_PROYECTO_FINAL_TBS,
  PARTITION FACT_FEB_2024 VALUES LESS THAN (TO_DATE('2024-03-01', 'YYYY-MM-DD')) TABLESPACE FIDE_PROYECTO_FINAL_TBS,
  PARTITION FACT_MAR_2024 VALUES LESS THAN (TO_DATE('2024-04-01', 'YYYY-MM-DD')) TABLESPACE FIDE_PROYECTO_FINAL_TBS,
  PARTITION FACT_ABR_2024 VALUES LESS THAN (TO_DATE('2024-04-10', 'YYYY-MM-DD')) TABLESPACE FIDE_PROYECTO_FINAL_TBS
);

